import React from 'react';
import ReactDOM from 'react-dom';


const tasks = ['take out garbage', 'this is second', 'this is third'];


const element = <ol>
    {tasks.map((tasks) => <li key> = {tasks}> {tasks} </li>)}
</ol>

// now we will be using jsx syntax

ReactDOM.render(element, document.getElementById('root'));
